  const headingStyle = {
    textAlign: 'center',
    marginBottom: '20px',
  };

  const imageWrapperStyle = {
    marginBottom: '20px',
  };
  return (
    <div>
      <header>
        <h1 class=" text-white">Our Work!</h1>
    </header>
    </div>
  )
}

export default Work1
